  input: '"TEXT","F3A","C00366948","The purpose of this Addendum is to notify the
    Commission that the Treasurer in conducting a review of the 2003 receipts and
    disbursements determined that the sum of Twenty One Thousand ($21000.00) Dollars
    was not contained in the referenced Quarterly Reports.  Seven (7) monthly disbursements
    in the amount of Three Thousand ($3000.00) Dollars each, to the best of our knowledge
    commencing in June and ending in December of 2003 were not reported upon information
    provided to the Treasurer by the Accountant.  These amounts were items made payable
    to the Accountant employed by the Committee to keep its financial records and
    make its reports.  Upon this discovery, the Accountant has been replaced by the
    Treasurer and this Report contains the items previously not reported.  The new
    Accountant has informed the Treasurer and the Counsel to the Committee that he
    does not have complete records upon which to make a conclusion whether or not
    that this Amendment may be in need of further updating.  Therefore the Committee
    reserves the right to correct this Amendment upon final scrutiny of all Committee
    records and financial institution records.  Very truly yours Brian F. Miller Treasurer
    William A. McDermott Jr. Committee Counsel Date:  4/15/04"'
